import React from 'react'
import {
    Button,
    ButtonGroup,
    CardBody,
    Card,
} from 'reactstrap';

import './Dashboard.css'
const Employee = (props) => {
    return (
        <div>
            <Card className='top-bar'>
                <CardBody>
                    <input type='search' name='search' className='search'></input>
                </CardBody>
            </Card>
        </div>
    );
}

export default Employee;
